import React from 'react';



const TestApi = () => {

  const [apiResponse, setResponse] = React.useState(null);
  const [apiUsers, setUsers] = React.useState(null);


  React.useEffect(() => {
    fetch('http://localhost:5000/time')
      .then(res => res.text())
      .then(response => setResponse(response)

      );
  }, []);
  React.useEffect(() => {
    fetch('http://localhost:9000/users')
      .then(res => res.text())
      .then(response => setUsers(response)

      );
  }, []);

  return (

    <div>
      API says: {apiResponse}<br />
      Users says: {apiUsers}
    </div>

  )
}

export default TestApi
